import React from 'react';

import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';






const Keep = (props) => {
    return (
        <>
            <div id="noteDiv">
                <h3>{props.title}</h3>
                <br />
                <p id="note">
                    The Content
                </p>
                <Button id="delbtn">
                    <DeleteIcon id="del" />
                </Button>
            </div>
        </>
    )
}




export default Keep;
